import React from 'react'
import Footer from './Footer';
import NavBar from './NavBar';

const Contacts = () => {
  return (
    <div>
        <NavBar/>
      <h2>It's Contacts Page</h2>
      <Footer/>
    </div>
  )
}

export default Contacts
